import base64
import io
import json
import os
import sys
import unittest

sys.path.insert(0, os.path.join(os.path.dirname(__file__), ".."))

from neon_sftp.utils.format_utils import str_to_bytes_io
from neon_sftp.connector import NeonSFTPConnector

tmp_file_object: io.BytesIO = None
sample_audio_string_b64 = """"""


class TestSFTPConnector(unittest.TestCase):
    connector: NeonSFTPConnector = None
    test_file_location = '/de/output_graph_test.tflite'

    @classmethod
    def setUpClass(cls) -> None:
        with open(os.path.expanduser(os.environ.get('SFTP_CREDS_PATH', '~/.local/share/neon/credentials.json'))) as f:
            sftp_creds = json.load(f)
            cls.connector = NeonSFTPConnector(**sftp_creds)

    @classmethod
    def tearDownClass(cls) -> None:
        cls.connector.shut_down()

    def test_00_base64_encoded_string_to_bytes_io(self):
        global tmp_file_object

        tmp_file_object = str_to_bytes_io(sample_audio_string_b64)
        self.assertTrue(tmp_file_object.getbuffer().nbytes > 0)

    def test_01_put_file_object(self):
        global tmp_file_object
        sftp_attrs = self.connector.put_file_object(file_object=tmp_file_object, save_to=self.test_file_location)
        self.assertIsNotNone(sftp_attrs)

    def test_02_get_file(self):
        save_to = 'output_graph.tflite'
        self.connector.get_file(get_from=self.test_file_location, save_to=save_to)
        self.assertTrue(os.path.exists(save_to))
        os.remove(save_to)
        self.assertTrue(not os.path.exists(save_to))

    def test_02_get_file_object(self):
        global tmp_file_object
        tmp_file_object = self.connector.get_file_object(get_from=self.test_file_location)
        self.assertTrue(tmp_file_object.getbuffer().nbytes > 0)
        self.assertEqual(base64.b64encode(tmp_file_object.getvalue()).decode(), sample_audio_string_b64)

    def test_03_remove_file_object(self):
        operation_success = self.connector.remove(remote_path=self.test_file_location)
        self.assertTrue(operation_success)


if __name__ == '__main__':
    unittest.main()
